import React from 'react';

const MixerIcon = () => {
  return (
    <svg width="50" height="50" viewBox="0 0 50 50" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
      <rect y="1" width="50" height="48.6842" fill="url(#pattern7)"/>
      <defs>
        <pattern id="pattern7" patternContentUnits="objectBoundingBox" width="1" height="1">
          <use xlinkHref="#image7" transform="scale(0.00328947)"/>
        </pattern>
        <image id="image7" width="304" height="296" xlinkHref="data:image/png;base64,"/>
      </defs>
    </svg>
  );
};

export default MixerIcon;
